import React from 'react';
import AppLayout from '../Components/AppLayout';
import Head from "next/head"
const Signup = () => {
    return (
        <>
        <Head>
            <title>회원가입 | SkkuBird</title>
        </Head>
        <AppLayout>
            회원가입 페이지
        </AppLayout>
        </>
    );
};

export default Signup;
